drop database if exists warehouse3;
create schema warehouse3;
use warehouse3;

create table Category (
	ID INT,
	Name VARCHAR(11),
	Descrip VARCHAR(4)
);

create table Customer (
	ID INT,
	Name VARCHAR(26),
	phone VARCHAR(50),
	Address VARCHAR(50),
	City VARCHAR(9),
	pin VARCHAR(50)
);

create table Orders (
	OrderID INT,
	ProductID INT,
	CustomerID INT,
	DateID INT,
	Quantity INT
);

create table Product (
	ID INT,
	Name VARCHAR(42),
	CategoryID INT,
	Price INT,
	Stock INT
);

create table Time (
	ID INT,
	Day VARCHAR(9),
	Date INT,
	Month INT,
	Year INT
);
